import React from 'react';
import Admin from './pages/Admin';
import SignIn from './pages/Admin/SignIn';
import Home from './pages/Home';
import Contact from './pages/Contact';

import './App.scss';

function App() {
  return (
    <div>
      <h1>Estamos en App.js</h1>
      <Admin />
      <SignIn />
      <Home />
      <Contact />
    </div>
  );
}

export default App;
